import React from "react";
import './mediaLink.css'; 
import "../../../assets/images/linkedIn_icon.png";
import "../../../assets/images/github_icon.png";

const MediaLink = ({ mediaLink, className, imgSrc, alt }) => {
    return (
        <a href={mediaLink}><img className={className} src={require(imgSrc)} alt={alt}></img></a>
    )
}

export default MediaLink;
